import React, { useState, useEffect } from 'react';
import UpperHeading from '../../Components/UpperHeading';
import './Planets.css';

const Planets = () => {
  const [planets, setPlanets] = useState([]);

  useEffect(() => {
    fetch('https://swapi.dev/api/planets/?format=json')
      .then(response => response.json())
      .then(data => {
        setPlanets(data.results);
      })
      .catch(error => {
        console.error('Error fetching planets data:', error);
      });
  }, []);

  return (
    <div>
      <UpperHeading />
      <div className="container mt-5">
        <div className="row">
          {planets.map(planet => (
            <div key={planet.name} className="col-lg-4 planet-button-div mb-5 mt-2">
              <button className='planet-button'>{planet.name}</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Planets;
